import React from 'react';

function About() {
  return (
    <section id="about">
      <h2>À propos de moi</h2>
      <p>Je suis ingénieur spécialisé en intelligence artificielle. Tout juste diplômé de CY Tech, je recherche un premier emploi en développement informatique (IA, web ou Python).</p>
      <p>Compétences principales : Python, Java, R, Docker, Git et Web (NodeJS et ReactJS).</p>
    </section>
  );
}

export default About;
